import { createRouter, createWebHistory } from 'vue-router';
import Home from '../views/Home.vue'; // Adjust path as per your structure
import ProductTable from '../components/ProductTable.vue'; // Adjust path as per your structure

const routes = [
{
    path: '/products',
    name: 'ProductTable',
    component: ProductTable
    },
{
path: '/',
name: 'Home',
component: Home
}
];

const router = createRouter({
history: createWebHistory(process.env.BASE_URL),
routes
});

export default router;
